// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ChoreList from './components/ChoreList';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={ChoreList} />
        {/* Add more routes as needed */}
      </Switch>
    </Router>
  );
}

export default App;
